import React from "react";
import { AiFillEdit } from 'react-icons/ai';
import { AiFillDelete } from 'react-icons/ai';
import { Link } from "react-router-dom";
SwiperCore.use([Navigation]);


function SearchCard(props) {
  const URL = '/DescCreche?name=' + props.name
  return (
    <div className="grid ">
      <div className="mx-1  my-3 rounded-2xl bg-white font-inter">
        <div className=" grid  text-center items-center w-full border-b-4 border-gray-100 border-t-4 my-3 ">
          <h1 className="font-inter text-3xl  text-rose-950 font-semibold  my-2 justify-self-center">{props.name} </h1>
        </div>
        <div className="grid grid-cols-2">
        <div className="grid justify-center pl-5 ">
          <h1 className="font-inter mt-5 mb-3 justify-self-center "> <span className="font-bold"> Nom : </span> {props.name} </h1>
          <h1 className="font-inter my-3 justify-self-center"> <span className="font-bold"> Location : </span>  {props.Commune} , {props.Wilaya} </h1>
          <h1 className="font-inter my-3  justify-self-center "> <span className="font-bold"> Description : </span> {props.Description} </h1>
          <a href={URL} className="justify-self-center" >
            <button className=" bg-red-400 text-white py-2 px-2  w-fit  rounded-md font-medium text-center mt-3 mb-5  ring-2 ring-gray-100 hover:bg-red-600 hover:scale-105 duration-0" title="Supprimer">
              Voir Plus
            </button>
          </a>
        </div>
         <div>
         <div className="flex  mx-auto max-w-[1050px] mt-7 py-5 px-0  gap-2 pio:gap-4 sm:gap-8  items-center  ">
        <div className="flex xxs:ml-[5%] ml-[1%] z-50" >
          <button onClick={() => sliderRef.current?.slidePrev()} className="bg-red-100   flex  justify-center items-center xxs:w-10 xxs:h-10 w-5 h-5 rounded-full ring ring-[#fc8280] shadow focus:outline-none hover:bg-white hover:ring-rose-900 hover:scale-125 duration-300">
            <svg
              viewBox="0 0 20 20"
              fill="currentColor"
              class="chevron-left w-6 h-6"
            >
              <path
                fill-rule="evenodd"
                d="M12.707 5.293a1 1 0 010 1.414L9.414 10l3.293 3.293a1 1 0 01-1.414 1.414l-4-4a1 1 0 010-1.414l4-4a1 1 0 011.414 0z"
                clip-rule="evenodd"
              ></path>
            </svg>
          </button>
        </div>

        <Swiper freeMode={true} grabCursor={true}
          Pagination={true}


          onSwiper={it => (sliderRef.current = it)} modules={[Navigation]}
          className="mySwiper bg-rose-100 w-[100%] rounded-xl ring-4  ring-[#fc8280] "
          slidesPerView={1} spaceBetween={25}



          breakpoints={{
            0: {
              slidesPerView: 1,
            },
            567: {
              slidesPerView: 1,
              spaceBetween: 15,
            },
            808: {
              slidesPerView: 1,
              spaceBetween: 25,
            },


          }}
        >

          {Images.map((slide, index) => {


            return (

              <SwiperSlide key={index} className="   mx-auto   flex   my-4 bg-whtie     " >

                <img className=" mx-auto mt-2  w-[95%] " src={Images[index]} alt="" />




              </SwiperSlide>



            );
          })}



        </Swiper>

        <div className="flex xxs:mr-[5%] mr-[1%] z-50" >
          <button onClick={() => sliderRef.current?.slideNext()} className="bg-red-100 ring ring-[#fc8280]   flex  justify-center items-center xxs:w-10 xxs:h-10 w-5 h-5 rounded-full shadow focus:outline-none hover:bg-white hover:ring-rose-900 hover:scale-125 duration-300">
            <svg
              viewBox="0 0 20 20"
              fill="currentColor"
              class="chevron-right w-6 h-6"
            >
              <path
                fill-rule="evenodd"
                d="M7.293 14.707a1 1 0 010-1.414L10.586 10 7.293 6.707a1 1 0 011.414-1.414l4 4a1 1 0 010 1.414l-4 4a1 1 0 01-1.414 0z"
                clip-rule="evenodd"
              ></path>
            </svg>
          </button>
        </div>

      </div>

         </div>

        </div>
      </div>
 


    </div>
  )


}

export default SearchCard;
